        "text": "Dnes v noci ke mě vlezl zloděj. Normálně bych spal, ale zazvonil nám telefon na pevné lince. K mému údivu ho vzal a otráveným hlasem utrousil: Kolikrát jsem ti říkal, abys mi nevolala do práce?",
        "date": "2012-09-22"
