        "text": "Tříletý chlapeček zvedne telefon. Volající se dožaduje hochovy maminky. Chlapeček do telefonu šeptá: \"Maminka nemůže, má moc práce.\" Hlas se tedy ptá po tatínkovi. Chlapec dál šeptá: \"Ten má také hodně práce.\" Volající se tedy ptá, zda je u nich doma nějaký jiný dospělý. Chlapec stále šeptá. \"Ano, je tu policista. Ale taky má hodně práce.\" Volající se tedy ptá dál, jací dospělí tam ještě jsou. Chlapec šeptá, že v bytě jsou ještě hasiči, ale také nemají vůbec čas. Volající už to nevydrží a rozčileně se ptá, co tam všichni dělají?! Chlapeček vítězoslavně šeptá: \"Hledají mě!\"",
