        "text": "Vypravovalo se o všelijakých podivných příhodách. A tu pak Kraus takto počal: \"Co byste řekli tomuhle. Jel jsem jednou do Anglie a na lodi bylo v podpalubí sto sudů se střelným prachem. A tu vám jeden sestoupil do podpalubí a hodil hořící sirku do jednoho sudu.\" \"Strašné,\" zvolali posluchači, \"no, a co? Ta loď vyletěla do povětří?\" \"To si myslíte vy,\" odvětil pan Kraus pohrdavě. \"Ale Bůh je mocný. Ta historie není vůbec pravdivá.\"",
