        "text": "Petrohradskou Ermitáž prochází skupinka turistů s průvodkyní a přijdou k obrazu, na kterém je kupka sena ze které trčí dva páry nohou.  Průvodkyně povídá: \"Toto dílo se jmenuje Lenin ve Finsku.\"\n Jeden turista se ptá: \"Aha, takže ty nohy špičkami nahoru, to jsou nohy Lenina?\"\n \"Ne, to jsou nohy Naděždy Krupské.\"\n \"Aha, takže ty nohy špičkami dolů jsou nohy Lenina?\"\n \"Ne, to jsou nohy Lva Trockého.\"\n \"A kde je Lenin?\"\n \"Ve Finsku.\"",
        "date": "2012-07-27"
