        "text": "Židovský mladík se chystá odcestovat na studia. Před odjezdem za ním přijde\notec: \"Podívej, dobře víš, že nejsme nikdy nebyli ortodoxní rodina a tradici\na víru neberem zas tak vážně. Ale slib mi jedno, nikdy, za žádnou cenu, si neber šiksu!\"\nSyn slíbí a ujistí otce, že se se to rozhodně nestane. Pochopitelně v posledním ročníku pozná blíže krásnou nežidovskou dívku a zamiluje se. Ona lásku opětuje, zažívají krásné chvíle, ale nakonec jí smutně sdělí, že si ji\nnemůže vzít, protože není židovka. Po chvilce přemýšlení odpoví: \"Netrap se\ntím. Konvertuji!\"\nPo náležité přípravě skutečně konvertuje, vezmou se a odjedou na svatební cestu do Monaka.\n\nPo čtyřech týdech zpátky doma, sobota 8 ráno, zvoní telefon. Je to mladíkův\notec a zní velmi rozčileně: \"Víš, že každou poslední sobotu v měsíci děláme\nv kanceláři inventuru, dnes je toho hodně, potřebujem pomoct, jaktože tu nejsi?!\" * \"Nemůžu přijít. Žena říká, že je to zakázané, protože je šábes. Chystáme se zrovna do synagogy.\"\n\nOtec křičí: \"Já ti říkal, neber si šiksu!!!\"",
